import github from '../img/github.svg';
import email from '../img/email.svg';
import linkedin from '../img/linkedin.svg';
import { Link } from 'react-router-dom';


function Footer() {
    return (
        <footer className="footer">
                <div className="link-container">
                    <a href="https://github.com/jdearden4/" target="_blank">test</a>
                    <a href="mailto:jdearden44@gmail.com" target="_blank"><img src={email}/></a>
                    <a href="https://www.linkedin.com/in/julia-dearden/" target="_blank"><img src={linkedin}/></a>
                </div>
        </footer>
    )
}
export default Footer;
